import React from 'react';
import Hero from '../Components/Hero';
import Content from '../Components/Content';

function AboutPage(props) {
    return(
        <div>
            <Hero title={props.title}/>
            <Content>

            <h4>Bullet Points</h4>
            <ul>
                <li>Fullstack software developer with an eye for design</li>
                <li>I am a photographer and have worked for </li>
                <li>I am a HUGE plant nerd. At one point I've had about ~100 plants and a backyard garden where I've re-wilded (I have just made it a word if it isn't already) the backyard while also increasing the biodiversity. I've counted ~20 species of birds that came to visit the yard! </li>
            </ul>

            <p>Jay is a software engineer with a passion for bringing beautiful design and functionality together.</p>
            <p>Before becoming a software engineer, Jay worked in e-commerce as a website manager and the in media as a photographer, photo producer and talent.</p>

            </Content>
        </div>
    );
}

export default AboutPage;
